window.bookSummaryJSON = "<p><b>Oliver Scott's technology breakthroughs are revolutionary. But he's hiding a devastating truth...</b></p> <p>Oliver Scott is the reclusive genius and trillionaire behind countless world-changing breakthroughs. How does he innovate at such a furious pace? While most hail him as a savior, what if he's actually the most dangerous tyrant humanity has ever seen? A man who will stop at nothing to gain absolute power.</p> <p>Liam Dunne is an elite American operative enhanced with next-level technology, including a prototype supercomputer implanted in his brain. When an encrypted data file is transmitted into this implant, Liam is thrust into a battle for the very soul of humanity. Because the file holds the key to unlocking the mystery of Oliver Scottâ€”and stopping a nightmarish future.</p> <p>As Liam and the woman he loves race to unravel the truth, they become the targets of a lethal manhunt initiated by the ruthless trillionaire. If they can survive long enough to access the enigmatic file, they can lift humanity to unimaginable heights.</p> <p>They're facing impossible odds. And time is running out...</p> <p><i>The Breakthrough Effect</i>&nbsp;is a propulsive, action-packed thriller with big ideas, mind-blowing technologies, and twists and turns you won't see coming.</p>"; 
